import apiPost from '../../services/service';
export default {
  data() {
    return {
      images: [],
      id: this.$route.params.id
    };
  },

  async mounted() {
    try {
      // Simple GET request using axios
      await apiPost.get(this.id).then(async response => {
        this.images = await response.data.content;
        console.log(this.images);
      });
    } catch (error) {
      console.log(error.message);
    }
  }

};
